import { useEffect, useState } from 'react';
import './App.css';

function App() {

  let [articles,setArticles] = useState([]);

useEffect (()=>{
  fetch('https://newsapi.org/v2/everything?q=india&from=2024-05-10&apiKey=950933e837d54f978c63581cba0249fe')
  .then((response)=>response.json())
  .then((news)=>{
    setArticles(news.articles);
  })
  .catch((error)=>{
    console.log(error)
  })

},[])

  return (
    <div className="App">
      <h1>News App</h1>
    </div>
  );
}

export default App;
